import React  from "react";
import { Link } from "react-router-dom";

export function NavMenuModule({types}){
    return(
        <React.StrictMode>
            <div>
            <nav>
            <ul>
                {
                    types.map(type => {
                        return(
                            <li>
                            {
                            type.title.map(typ => {
                                <Link to={typ.href}>
                                    {
                                        typ.name
                                    }
                                </Link>
                            })
                            }
                            </li>
                        )
                    })
                }
            </ul>
            </nav>
            </div>
        </React.StrictMode>
    )
}
